            List<Scene> allScenesInProject = new List<Scene>();

            int sceneCount = SceneManager.sceneCountInBuildSettings;

            for (int i = 0; i < sceneCount; i++)
            {
                Scene currentScene = SceneManager.GetSceneByBuildIndex(i);
                allScenesInProject.Add(currentScene);
            }

            foreach (var s in allScenesInProject)
            {
                if (s.name.Equals(sceneName))
                {
                    scene = s;
                    sceneIndex = s.buildIndex;
                    return true;
                }
            }

            return false;
        }
    }
